style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("java.net"),
domain("java.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, font, strong, form, footer

{
color: white !important;
background: black !important;
}

select, button, .jvdl0v0 div, a.jvdla0, div#block-menu-menu-footer-menu, div.cpanel-inner, div.jvcs0w0

{
background: black !important;
}

div, span

{
background-color: black !important;
}

select, input, span, code, textarea, pre, label, div, dd

{
color: white !important;
}


/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code

{
background: #333333 !important;
}

}
